import React from "react";
import "./App.css";
import Loginimg from "./componetc/Loginimg";
import { Route , Switch } from "react-router-dom";
import Log from "./componetc/Log";
// import Dashbord from "./componetc/ashbord/Dashbord";



function App() {
  return (
    <>
     <Switch>
       <Route path="/" Component={Loginimg}/>
       <Route path="/"/>
     </Switch>
      {/* <Loginimg /> */}
     {/* <Dashbord/> */}
     <Log/>
    </>
  );
}

export default App;
